import React from "react";

function Footer() {
  return (
    <div className="footer-main">
      <div className="wrap">
        <div className="subject-footer"></div>
        <div className="links-footer"></div>
        <div className="reviews-footer"></div>
        <div className="deals-footer"></div>
      </div>
    </div>
  );
}

export default Footer;
